import React from 'react';
import Filter from "./Filter"
import Sliders from './Sliders';

const Filters = (props) => {

  console.log(props)

return (
    <div>
    <h2>FILTERS</h2>
    {props.filters.map((filter) => (
      <>
      {filter.type != 'slider' ?
          (
          <Filter
            active={filter.facet_active}
            label={filter.label}
            field={filter.field}
            values={filter.values}
            selectFilter={filter.onChange}
          />) : (
            <Sliders 
            active={filter.facet_active}
            label={filter.label}
            field={filter.field}
            range={filter.range}
            />
            )}
      </>
        ))}
    </div>
)

}

export default Filters;
